import React from "react";
import { BrowserRouter as Router, Link, Route } from "react-router-dom";
import Products from "../DB/products.json";
import { Headphones } from "./Headphones";

export const Categories = props => {
  return (
    <Router>
      <div className="categories">
        <ul>
          <li>
            <Link to="/categories/headphones">Headphones</Link>{" "}
          </li>
          <li>
            {" "}
            <Link to="/categories/phones">Phones</Link>{" "}
          </li>
          <li>
            {" "}
            <Link to="/categories/laptops">Laptops</Link>{" "}
          </li>
          <li>
            {" "}
            <Link to="/categories/cameras">Cameras</Link>{" "}
          </li>
        </ul>

        <Route
          path="/categories/headphones"
          render={() => <Headphones items={Products.HEADPHONES} />}
        />
        <Route path="/categories/phones" component={Headphones} />
      </div>
    </Router>
  );
};
